:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  JDAVIES, George Henry and GODFREY, Rose Alma
  IDAVIES, Christopher ap Rhys and HAWKES, Lilian Margaret
  JDAVIES, Helen Rose and VICKERMAN, John D'Arcy
  JVICKERMAN, Anthony Rhys and PERCIVAL, Raewyn Jean
  | 02> VICKERMAN, Anthony Rhys m on 04.09.1976 to PERCIVAL, Raewyn Jean
  b 14.04.1954
  b 25.11.1954
  Tony, twin brother of David, b. at Lower Hutt and m. at St John's Church,
  Willis Street, Wellington. Raewyn, d/o Raymond Percival and Jean Gordon,
  b, at Wanganui. Address: 68 Hautana Street, Lower Hutt.
  Tony was educated at Eastern Hutt Primary School (1959-62); Wellesley
  College (1962-66); Hutt Valley High School (1967-72); Victoria University
  (1973); Wellington Polytechnic and the University of Canterbury. He was a
  committee member of the Victoria University Ski Club for three years. He obtained a NZ Certificate
  of Engineering from the Polytechnic and Bachelor of Engineering (Civil) from the University of
  Canterbury. After graduation he worked for a short time for a construction company and then for a
  firm of structural engineers in Lower Hutt. He and a partner then set up a housing construction
  business. Later he and the same partner established Harbour Capital Properties Ltd and set about
  acquiring and leasing commercial properties. He is a Founder Board Member of a new Independent
  Boys' Secondary School - the first new school for boys in the Wellington region. He has built and
  altered three houses, the latest being a substantial renovation of their present home. His leisure
  interests include boating, water and snow skiing and tennis.
  Raewyn was educated at Muritai School, Eastbourne; Wellington Girls' College and later at the
  Wellington Polytechnic and Hutt Valley Polytechnic. While at school she was a member of the
  Wellington Girls' College Netball and Tennis "A" Teams. She gained a Secretarial Certificate from
  the Wellington Polytechnic and, from the Hutt Valley Polytechnic, a first class pass in Pitman Word
  Processing. She has served on committees of the Plunket Society, the Wellesley College School and
  the Lower Hutt Tennis Club. She worked as a secretary for Norwich Union Insurance, Caltex Oil, ICI
  (NZ) Ltd and CB Norwood before marriage and is currently a Beauty Consultant for Estee Lauder. Her
  other interests include dog showing, gardening, handicrafts, music and tennis.
  01> VICKERMAN, Brooke Jean
  b 20.08.1980
  Brooke b, at Lower Hutt. She attends Chilton Saint James School where she won the Junior
  Swimming Championship, was awarded the Little Chilton Cup for Academic Excellence in 1991 and
  gained a three year school scholarship. Her interests include piano, swimming and hockey.
  02> VICKERMAN, Hamish Anthony
  b 28.01.1983
  Hamish b. at Lower Hutt. He attends Wellesley College and won the Junior Championship in both
  swimming and athletics. He is a keen and talented rugby player and has represented the Hutt
  Valley. He is also a keen cricketer.
  03> VICKERMAN, Kendyl Rose
  b 05.06.1984
  Kendyl b. at Lower Hutt. She attends Chilton Saint James and is interested in singing, piano
  playing, ballet and swimming.
  03> VICKERMAN, Judith Anne m on 31.01.1981 to BEVIN, Nicholas Peter
  b 04.08.1955
  b 18.09.1955
  Judith has not taken the name Bevin. Nicholas, s/o Robert Bevin and Joan
  Rothery. Address: 69 Richmond Street, Petone.
  Judith was educated at Eastern Hutt Primary School, Chilton Saint James,
  Wellington Polytechnic and Victoria University. A keen sportsperson, she
  represented her school in tennis, swimming and hockey and was the
  recipient of the Gold Duke of Edinburgh Award. In 1976 she went overseas
  for two years, travelling throughout England and Europe.
